import React from 'react';
import { useNavigate, useParams } from 'react-router-dom';
import { ObjectItem } from '../types';
import useFetch from '../hooks/useFetch';

type Params = { stationId: string };

const ObjectSelectionPage: React.FC = () => {
  const { stationId } = useParams<Params>();
  const navigate = useNavigate();
  const { data: objects } = useFetch<ObjectItem[]>(`/api/stations/${stationId}/objects`);

  return (
    <div>
      <button onClick={() => navigate(-1)}>← Назад</button>
      <h1>Объекты локации {stationId}</h1>
      <ul>
        {objects?.map(obj => (
          <li key={obj.id} onClick={() => navigate(`/object/${obj.id}`)}>
            {obj.name} {obj.hasAlert && '⚠️'}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default ObjectSelectionPage;
